import { useEffect, useState, useCallback } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import jsPDF from "jspdf";
import Cookies from "js-cookie";
import "jspdf-autotable";
import "../styles/pagesstyle.css";
import navLogo from "../assets/dashboard_logo.png";
import homeLogo from "../assets/expence_tracker_home_page.png";
import logo from "../assets/Logo.png";

const Dashboard = ({ email }) => {
  const [userData, setUserData] = useState(null);
  const [error, setError] = useState("");
  const [expenses, setExpenses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [deleteIds, setDeleteIds] = useState("");
  const [formData, setFormData] = useState({
    amount: "",
    category: "",
    description: "",
    email: email || "",
  });

  const navigate = useNavigate();
  const jwtToken = Cookies.get("jwt_token");

  // Fetch user data
  const fetchUserData = useCallback(() => {
    if (!email) return;
    axios
      .get(`http://localhost:5000/dashboard?email=${email}`)
      .then((res) => setUserData(res.data))
      .catch(() => setError("Failed to load user data."));
  }, [email]);

  // Fetch expenses
  const fetchExpenses = useCallback(() => {
    if (!email) return;
    axios
      .get(`http://localhost:5000/get-pdf?email=${email}`)
      .then((res) => setExpenses(res.data))
      .catch(() => setError("Failed to load expenses."))
      .finally(() => setLoading(false));
  }, [email]);

  // Run on mount
  useEffect(() => {
    if (!jwtToken) {
      navigate("/login");
    } else {
      fetchUserData();
      fetchExpenses();
    }
  }, [jwtToken, navigate, fetchUserData, fetchExpenses]);

  // Handle input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Add expense
  const handleAddExpense = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/add-expense", { ...formData, email });
      alert("Expense added successfully!");
      setFormData({ amount: "", category: "", description: "", email });
      fetchUserData();
      fetchExpenses();
    } catch (err) {
      alert("Failed to add expense.");
      console.error(err);
    }
  };

  // Delete expenses
  const handleDeleteExpense = async (e) => {
    e.preventDefault();
    const idsArray = deleteIds
      .split(",")
      .map((id) => id.trim())
      .filter((id) => id !== "");

    if (idsArray.length === 0) {
      alert("Please enter at least one valid expense ID.");
      return;
    }

    try {
      await axios.delete("http://localhost:5000/delete-expense", {
        data: { email, ids: idsArray },
        headers: { "Content-Type": "application/json" },
      });
      alert("Expenses deleted successfully!");
      setDeleteIds("");
      fetchUserData();
      fetchExpenses();
    } catch (err) {
      alert("Failed to delete expenses.");
      console.error(err);
    }
  };

  // Download PDF
  const handleDownloadPDF = async () => {
    try {
      if (expenses.length === 0) {
        alert("No data available to generate PDF.");
        return;
      }

      const doc = new jsPDF();
      doc.setFontSize(16);
      doc.text("Expense Report", 14, 15);

      const headers = [["ID", "Category", "Description", "Amount"]];
      const data = expenses.map((item, index) => [
        index + 1,
        item.category || "Unknown",
        item.description || "No description",
        `${item.amount}`,
      ]);

      doc.autoTable({
        startY: 20,
        head: headers,
        body: data,
        theme: "grid",
        styles: { halign: "center" },
        headStyles: { fillColor: [0, 153, 255] },
      });

      doc.save("expenses.pdf");
    } catch (err) {
      alert("Failed to generate PDF.");
      console.error(err);
    }
  };

  if (!jwtToken) return null; // Redirect handled in useEffect

  if (!userData) return <p>Loading...</p>;

  return (
    <div className="dashboard-content">
      {/* Navbar */}
      <nav className="dashboard-navbar">
        <div className="dashboard-logo">
          <img src={navLogo} alt="Logo" className="logo" />
        </div>
        <div className="dashboard-buttons">
          <button className="dashboard-button"><a href="#sectionHome">Home</a></button>
          <button className="dashboard-button"><a href="#sectionExpense">Expenses</a></button>
          <button className="dashboard-button"><a href="#sectionData">Your Data</a></button>
        </div>
      </nav>

      {/* Home Section */}
      <section id="sectionHome">
        <h1>Hi, {userData.username}</h1>
        <h2>Welcome to Expense Tracker Dashboard</h2>
        <p>Manage your daily expenses efficiently.</p>
      </section>

      {/* Expense Section */}
      <section id="sectionExpense">
        <form onSubmit={handleAddExpense}>
          <input type="number" name="amount" placeholder="Amount" value={formData.amount} onChange={handleChange} required />
          <input type="text" name="description" placeholder="Description" value={formData.description} onChange={handleChange} required />
          <select name="category" value={formData.category} onChange={handleChange} required>
            <option value="Income">Income</option>
            <option value="Expense">Expense</option>
          </select>
          <button type="submit">Add Expense</button>
        </form>

        <form onSubmit={handleDeleteExpense}>
          <input type="text" placeholder="Enter Expense IDs, e.g., 1,2,3" value={deleteIds} onChange={(e) => setDeleteIds(e.target.value)} />
          <button type="submit">Delete Expenses</button>
        </form>
      </section>

      {/* Data Section */}
      <section id="sectionData">
        <h3>Total Income: ₹{userData.totalIncome}</h3>
        <h3>Total Expense: ₹{userData.totalExpense}</h3>
        <h3>Total Balance: ₹{userData.totalIncome - userData.totalExpense}</h3>
        <button onClick={handleDownloadPDF}>Download PDF 📄</button>

        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Category</th>
              <th>Description</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            {userData.expenses.map((exp) => (
              <tr key={exp.user_expense_id}>
                <td>{exp.user_expense_id}</td>
                <td>{exp.category}</td>
                <td>{exp.description}</td>
                <td>₹ {exp.amount}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* Footer */}
      <footer>
        <p>&copy; 2025 Expense Tracker</p>
        <img src={logo} alt="footer-logo" />
      </footer>
    </div>
  );
};

export default Dashboard;
